import "./App.css";
import Split from "react-split";
import Window1 from "./components/Window1";
import Window2 from "./components/Window2";
import Window3 from "./components/Window3";

function App() {
  return (
    <Split direction="vertical" style={{ height: "auto" }}>
      <Split direction="horizontal" style={{ display: "flex" }}>
        <Window1 />
        <Window2 />
      </Split>
      <Window3 />
    </Split>
  );
}

export default App;
